import React, { useState, useEffect } from 'react';
import { useNavigate, useLocation } from 'react-router-dom';
import { ArrowLeft } from 'lucide-react';

const ResultsPage = () => {
  const [trafficData, setTrafficData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const navigate = useNavigate();
  const location = useLocation();

  useEffect(() => {
    const searchParams = new URLSearchParams(location.search);
    const name = searchParams.get('name');
    const address = searchParams.get('address');

    const fetchTrafficData = async () => {
      try {
        // Step 1: Search for the venue
        const searchResponse = await fetch(
          `https://besttime.app/api/v1/venues/search?` + 
          new URLSearchParams({
            api_key_public: 'pub_3d06d92b6c19492fb4c5bc825d04ab4c',
            q: `${name} ${address}`
          })
        );

        const searchData = await searchResponse.json();

        if (searchData.status !== 'OK' || !searchData.venues || searchData.venues.length === 0) {
          throw new Error(searchData.message || 'No venues found');
        }

        const venue = searchData.venues[0];

        // Step 2: Get the live forecast for the found venue
        const forecastResponse = await fetch(
          `https://besttime.app/api/v1/forecasts/live?` + 
          new URLSearchParams({
            api_key_private: 'pri_070565f833f9459aad223978a7a19b74',
            venue_id: venue.venue_id
          })
        );

        const forecastData = await forecastResponse.json();

        if (forecastData.status !== 'OK') {
          throw new Error(forecastData.message || 'Failed to fetch forecast data');
        }

        setTrafficData(forecastData);
      } catch (err) {
        setError(err.message || 'Failed to fetch traffic data. Please try again later.');
        console.error('API Error:', err);
      } finally {
        setLoading(false);
      }
    };

    if (name && address) {
      fetchTrafficData();
    } else {
      setError('No venue information provided.');
      setLoading(false);
    }
  }, [location.search]);

  const formatDateTime = (dateTimeString) => {
    return new Date(dateTimeString).toLocaleString('en-US', {
      weekday: 'long',
      year: 'numeric',
      month: 'long',
      day: 'numeric',
      hour: '2-digit',
      minute: '2-digit'
    });
  };

  return (
    <div className="min-h-screen bg-gray-100 p-8">
      <div className="max-w-2xl mx-auto">
        <button 
          onClick={() => navigate('/')}
          className="flex items-center text-blue-600 hover:text-blue-800 mb-6"
        >
          <ArrowLeft className="mr-2" size={20} />
          Back to Search
        </button>

        {loading && (
          <div className="text-center text-gray-600">
            Loading traffic data...
          </div>
        )}

        {error && (
          <div className="text-center text-red-500 mb-4">
            Error: {error}
          </div>
        )}

        {trafficData && !loading && !error && (
          <div className="bg-white rounded-lg shadow-md p-6">
            <h1 className="text-2xl font-bold mb-4">{trafficData.venue_info.venue_name}</h1>
            <div className="mb-4">
              <h2 className="text-lg font-semibold mb-2">Current Traffic</h2>
              <p className="text-xl">
                {trafficData.analysis.now.intensity_txt}
                <span className="ml-2 text-sm text-gray-500">
                  (Level: {trafficData.analysis.now.intensity})
                </span>
              </p>
            </div>
            <div className="mb-4">
              <h2 className="text-lg font-semibold mb-2">Local Time</h2>
              <p>{formatDateTime(trafficData.venue_info.venue_current_localtime)}</p>
            </div>
            <div className="mb-4">
              <h2 className="text-lg font-semibold mb-2">Time Zone</h2>
              <p>{trafficData.venue_info.venue_timezone}</p>
            </div>
            <div>
              <h2 className="text-lg font-semibold mb-2">Last Updated</h2>
              <p>{formatDateTime(trafficData.forecast_updated_on)}</p>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default ResultsPage;
